import React, { Component } from 'react';

class Button extends Component {
    render() {
        return (
            <React.Fragment>
                <button>
                    <i className="fas fa-cart-plus"></i>My Cart
                </button>
            </React.Fragment>
        );
    }
}

export default Button;
